import React from "react";
import { Button } from "react-bootstrap";
import MoneyCard from "./Cards/MoneyCard";

const Goals = () => {
  return (
    <div>
      <div className="mx-0 col-lg-3" style={{ backgroundColor: "" }}>
        <div className="my-5">
          <div className="row justify-content-around">
            <div className="my-2 col-lg-12 col-md-3 col-sm-5">
              <h3>Goals</h3>
            </div>
            <div className="my-2 col-lg-12 col-md-3 col-sm-5">
              <MoneyCard amount={"$850.00"} title={"MacBook Air"} />
            </div>
            <div className="my-2 col-lg-12 col-md-3 col-sm-5">
              <MoneyCard amount={"$75.00"} title={"Nike Cortez"} />
            </div>
            <div className="my-2 col-lg-12 col-md-3 col-sm-5">
              <MoneyCard amount={"$350.00"} title={"Gaming Monitor"} />
            </div>
            <div
              className="row mt-2 mb-5 col-lg-12 col-md-3 col-sm-5 d-flex justify-content-center"
              style={{ backgroundColor: "" }}
            >
              <Button size="lg" variant="outline-secondary">
                Add Goal
              </Button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Goals;
